  const paperStyle = {
    padding: "45px",
    width: "28%",
    height: "400px",
    display: "flex",
    flexDirection: "column",
    justifyContent: "space-between",
    alignItems: "center",
  };
  return (
    <>
      <div>
        <form>
          <TextField fullWidth label="نام کاربری" variant="outlined" />
          <TextField fullWidth label="رمز عبور" variant="outlined" />
        </form>
      </div>
    </>
  );
}
